import React from 'react';
import PropTypes from 'prop-types';
import { PopupboxManager, PopupboxContainer } from 'react-popupbox';

const setProfileImage = (props) => {
  const updatePopupbox = () => {
    const content = (
      <div>
        <span>Update popupbox with new content and config</span>
        <button onClick={PopupboxManager.close}>Close</button>
      </div>
    );

    PopupboxManager.update({
      content,
      config: {
        titleBar: {
          text: 'Updated!',
        },
      },
    });
  };

  const openPopupbox = () => {
    const content = (
      <div className="conm">
        <span>Open popupbox</span>
        <button onClick={updatePopupbox}>Update!</button>
      </div>
    );

    PopupboxManager.open({
      content,
      config: {
        titleBar: {
          enable: true,
          text: 'Step 1',
        },
        fadeIn: true,
        fadeInSpeed: 500,
      },
    });
  };

  return (
    <div>
      <button onClick={openPopupbox}>Click me</button>
      <PopupboxContainer />
    </div>
  );
};

setProfileImage.propTypes = {};

export default setProfileImage;
